  display: flex;
  justify-content: center;
  align-items: center;
  margin-top: 30px;
  flex-direction: column;
`;

export const ProfileWrapper = styled.div`
  display: flex;
  width: 1194px;
  height: 300px;
  border: 1px solid black;
  justify-content: center;
  align-items: center;
`;

export const MyPostWrapper = styled.div``;

